    var x;
    var x=parseInt(document.getElementById("{FormElement:TIME_SW001}").value);
    function countDown(){

	 x+= 1;
                document.getElementById("{FormElement:TIME_SW001}").value=x;
	if(x==5)
	document.getElementsByTagName('button')[1].click();	
	console.log("counted down: ",x);

    };

 var myVar = setInterval(function() {
countDown()
}, 1000);

</script>

