function getKey(){
document.onkeydown = function(e){
   if(e.keyCode == 70){
     console.log("f");
     document.getElementById('{FormElement:SW027}').value="";
     document.getElementById('{FormElement:SW027}').value="f";
     document.getElementsByTagName('button')[1].click();
   }
   else if(e.keyCode == 68){
     console.log("d");
     document.getElementById('{FormElement:SW027}').value="";
     document.getElementById('{FormElement:SW027}').value="d";
     document.getElementsByTagName('button')[1].click();
   }
   else if(e.keyCode == 71){
     console.log("g");
     document.getElementById('{FormElement:SW027}').value="";
     document.getElementById('{FormElement:SW027}').value="g";
     document.getElementsByTagName('button')[1].click();
   }
   else if(e.keyCode == 74){
     console.log("j");
     document.getElementById('{FormElement:SW027}').value="";
     document.getElementById('{FormElement:SW027}').value="j";
     document.getElementsByTagName('button')[1].click();
   }
   else if(e.keyCode == 72){
     console.log("h");
     document.getElementById('{FormElement:SW027}').value="";
     document.getElementById('{FormElement:SW027}').value="h";
     document.getElementsByTagName('button')[1].click();
   }
   else if(e.keyCode == 75){
     console.log("k");
     document.getElementById('{FormElement:SW027}').value="";
     document.getElementById('{FormElement:SW027}').value="k";
     document.getElementsByTagName('button')[1].click();
   }
  else if(e.keyCode == 32){
     console.log("space");
     document.getElementById('{FormElement:SW027}').value="";
     document.getElementById('{FormElement:SW027}').value="spacebar";
     document.getElementsByTagName('button')[1].click();
   }
};
};

